import React from "react";
import md5 from "md5";

function Gravatar(props) {
  const email = props.email;
  // const hash = md5(email);

  return (
    <img
      className={props.className}
      src={`https://www.gravatar.com/avatar/${md5(email)}?d=identicon`}
      alt="Avatar"
    />
  );
}

export default Gravatar;
